import { Link } from "react-router-dom"

export default function Header(){
    return(
        <nav>
            <h1>Projeto de </h1>
           <ul>
                <li><Link to="/">Principal</Link></li>
                <li><Link to="/entrar">Entrar</Link></li>
                <li><Link to="/cadastrar">Cadastrar</Link></li>
           </ul>
        </nav>
    )
}
